"""IN this section I calculate 5 additional features apart from the ones mentioned above.
They are
1. [text_ari_score] - Automated_readability_index :
The automated readability index (ARI) is a readability test for English texts, designed to gauge the understandability of a text. Like the Flesch–Kincaid grade level, Gunning fog index, SMOG index, Fry readability formula, and Coleman–Liau index, it produces an approximate representation of the US grade level needed to comprehend the text.
Why this? Because its simple and doesn't requires syllable i.e phonetic interpretation.

2. [summary_len_percent] Summary Length percentage:
This is a simple percentage of length of summary  by length of actual prompt_text. Ideally it should be neither too long or nor too short. So between 5-15 %

3. [text_similarity_score] - Text Similarity Score:
This is the norm of cosine similarity betweeen 2 text .While this is a fairly good estimate of text similarity it has some limitations It converts text to tokens and then into further vectors removing the grammatical construct that language imposes, which is necessary for a good essay.

To counter this, I chose another parameter albeit much more time-consuming to incorporate becasue of environmental issues. Both these libraries take more time as they rely on remote databases and have to contact it via remote API calls for a given text.

4. [grammar_correction_cnt] It uses language_tool_python, a python library that provides grammatical (spelling + grammar) error counts in a text.

5. [has_bad_words] - Type Boolean , later converted to One hot encoded columsn to take care of th ecategorical nature
This uses profanity library to identify whether the given text has any sort of profane words. I used a very simple implementationof Yes or no to cater the same.


"""

## !! Expected Runtime between 8 min and 12 min !!

## Calculating additional features -------------------

# Feature 1 -Automated_readability_index
def calculate_ari_score(text):
    space_cnt=text.count(" ")
    character_cnt=len(re.findall('[0-9A-z]',text))
    sentences_arr = sent_tokenize(text)
    sentence_cnt=len(sentences_arr)
    ari=(4.71*(character_cnt/space_cnt))+(0.5*(space_cnt/sentence_cnt))-21.43
    return math.ceil(ari)

dl5=idom[["text"]].applymap(calculate_ari_score)
dl5.rename(columns={'text':'text_ari'})
